INSERT INTO `v1_c6bd16abcbb179b58002d632507610cc5cffd482246bb2930a68ce6a9fc5ada8` VALUES (14112, 11, 1, 10, 105611, "上出来、上出来。\nさて、絵も完成したことだし、\nみんなでパパっと片づけをして\n食事にでも行くとするかい。", 14112030, 0, 0, 1, 0.5);
