INSERT INTO `v1_c6bd16abcbb179b58002d632507610cc5cffd482246bb2930a68ce6a9fc5ada8` VALUES (19812, 11, 1, 10, 105311, "いや、浮世絵って\nこんな感じだったか？\nオーエドで見たのは、もう少し\n違う雰囲気だった気がするのだが。", 19812034, 0, 0, 1, 0.5);
